import React from "react";
import {
    Container,
    Content,
    WrapperForm,
    FormUser,
    Input,
    ButtonSubmit,
    LoginInfo,
} from "./FormStyle";
const Form = () => {
    return (
        <Container>
            <Content>
                <h2>Este site foi totalmente desenvolvido por <span>Marcos Proença</span></h2>
                <p>Site simples, mais objetivo. O intuito é mostrar um pouco de UI, deixando claro algumas habilidades.</p>
                </Content>
            <WrapperForm>
                <h2>Faça login</h2>
                <FormUser>
                    <WrapperInput>

                    </WrapperInput>
                    <Input />
                    <Input />
                    <ButtonSubmit />
                    <LoginInfo>
                        <button></button>
                        <span>Lembrar de mim</span>
                        <span>Esqueceu a senha?</span>
                    </LoginInfo>
                </FormUser>
            </WrapperForm>
        </Container>
    );
};

export default Form;
